import React, { Component } from 'react'
import QuestionCard from './QuestionCard'
import AnswerCard from './AnswerCard'

class QuestionList extends Component {

  render () {
    const { ids, text } = this.props
      return (
        <div className='container'>
            <div className='question-list'>
              <h1 className='special-text'>{text}</h1>

              <ul>
                {(text==='Unanswert Questions') ?
                  ids.map((qId) => (
                    <li key={qId}>
//                      <QuestionCard id={qId} />
                      <p>Would you rather {optionOne} than {optiontwo}?</p>
                    </li>
                  ))

                  :
                  ids.map((qId) => (
                    <li key={qId}>
                      <p>Would you rather {optionOne} than {optiontwo}?</p>
//                      <AnswerCard id={qId} />
                    </li>
                  ))

                }

              </ul>

            </div>
        </div>
      )
  }
}



export default QuestionList
